import React from "react";
import { Global } from "../Styles/Global.Styles";
import { Route, Routes } from "react-router-dom";
import HomePage from "../Pages/HomePage/HomePage";

function AppRoutes() {
  return (
    <>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </>
  );
}

export default AppRoutes;
